import React, { Component } from 'react';
import Card from "../components/Card";

function Project(props) {
    return (
        <div 
            className = "card"
            style = {{
                backgroundImage: props.image ? `url(${props.image})` : "none"
            }}
            ></div>

    )
}

export default Project;
